script: |
  super -f text -I q951.spq | sort > q951.out

inputs:
  - name: q951.spq
    data: |
      SELECT - 79 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 16 IN ( + col0 * - 71 + + col1, CAST ( 67 AS INTEGER ) / - + 32, col0 );
  - name: tab1

outputs:
  - name: q951.out
    data: |
      -79
      -79
      -79
